        stack = []
        for char in s:
            if char in grammar.keys():
                stack.append(char)
            else:
                if len(stack) > 0 and stack[-1] == grammar[char]:
                    stack.pop()
                else:
                    return None
        if len(stack) == 0:
            return "Yes"
        else:
